import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { View, Text, StyleSheet, TouchableOpacity, Image, TextInput, Picker } from 'react-native';

const PersonDetail = ({ persons }) => {
    const { id } = useParams(); // ID aus der URL
    const [person, setPerson] = useState(null);
    const [imageUri, setImageUri] = useState('https://via.placeholder.com/250');
    const [selectedTab, setSelectedTab] = useState('Allgemein'); // Initialer Tab
    const [error, setError] = useState(null);

    useEffect(() => {
        const foundPerson = persons.find((p) => p.personenNr.toString() === id); // Finde die Person anhand der ID
        if (!foundPerson) {
            setError('Person nicht gefunden!');
        } else {
            setPerson(foundPerson);
        }
    }, [id, persons]);

    const handleImageUpload = () => {
        const input = document.createElement('input');
        input.type = 'file';
        input.accept = 'image/*';
        input.onchange = (e) => {
            const file = e.target.files[0];
            if (file) {
                const reader = new FileReader();
                reader.onload = () => setImageUri(reader.result);
                reader.readAsDataURL(file);
            }
        };
        input.click();
    };

    const renderTabContent = () => {
        if (!person) return null;

        switch (selectedTab) {
            case 'Allgemein':
                return (
                    <>
                        <Text style={styles.fieldLabel}>Vorname: {person.vorname}</Text>
                        <Text style={styles.fieldLabel}>Nachname: {person.nachname}</Text>
                        <Text style={styles.fieldLabel}>Personen-Nummer: {person.personenNr}</Text>
                    </>
                );
            case 'Kontakte':
                return (
                    <>
                        <Text style={styles.fieldLabel}>Telefon: {person.telefon}</Text>
                        <Text style={styles.fieldLabel}>E-Mail: {person.email}</Text>
                    </>
                );
            default:
                return <Text>Keine Daten vorhanden</Text>;
        }
    };

    if (error) {
        return (
            <View style={styles.container}>
                <Text style={styles.error}>{error}</Text>
            </View>
        );
    }

    return (
        <View style={styles.container}>
            <View style={styles.header}>
                <View style={styles.nameContainer}>
                    <Text style={styles.titleText}>{person?.vorname}</Text>
                    <Text style={styles.titleText}>{person?.nachname}</Text>
                </View>
                <TouchableOpacity onPress={handleImageUpload}>
                    <Image source={{ uri: imageUri }} style={styles.image} />
                </TouchableOpacity>
            </View>
            <View style={styles.tabBar}>
                {['Allgemein', 'Kontakte'].map((tab, index) => (
                    <TouchableOpacity
                        key={index}
                        style={[
                            styles.tabButton,
                            selectedTab === tab && styles.activeTab,
                        ]}
                        onPress={() => setSelectedTab(tab)}
                    >
                        <Text style={styles.tabText}>{tab}</Text>
                    </TouchableOpacity>
                ))}
            </View>
            <View style={styles.content}>{renderTabContent()}</View>
        </View>
    );
};

const styles = StyleSheet.create({
    container: { flex: 1, padding: 20, backgroundColor: '#fff' },
    error: { color: 'red', textAlign: 'center', marginTop: 20 },
    header: { flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center', marginBottom: 20 },
    nameContainer: { flex: 1 },
    titleText: { fontSize: 24, fontWeight: 'bold', color: '#444' },
    image: { width: 100, height: 100, borderRadius: 50, borderWidth: 1, borderColor: '#ccc' },
    tabBar: { flexDirection: 'row', justifyContent: 'space-around', marginBottom: 20 },
    tabButton: { padding: 10 },
    activeTab: { borderBottomWidth: 2, borderBottomColor: '#f0af4d' },
    tabText: { fontSize: 16, color: '#666' },
    content: { padding: 10 },
    fieldLabel: { fontSize: 18, marginBottom: 10, color: '#333' },
});

export default PersonDetail;
